    const style={
        App:{
            backgroundColor:"black",
        },
        h2:{
            color:"red",
        },
        bold_text:{
            color:"green",
        },
    };
    return (
        <div style={style.App}>
            <MyHeader/>
            <header className="App-header">
                <h2>Hello React (adam)</h2>
                <b id="bold_text"> React.js</b>
            </header>
        </div>
    );
}

export default App;
